    <div className="App">
      <div>
        TABS:
        <div onClick={() => setTab('one')}>Tab One</div>
        <div onClick={() => setTab('two')}>Tab One</div>
      </div>

      <div>
      {tab === 'one' && <header className="App-header">
      

       
      <CreateTable/>
      </header>
      }
    </div>
    </div>
  );
}

export default App;
